import React from 'react';
import styled, {css} from 'styled-components';
import ImageHalf from "./ImageHalf";
import ImageTall from "./ImageTall";
import WeirdImageGrid from "./WeirdImageGrid"
import Video from "./Video";
import BlueBack from "./BlueBack";
import SectionReverse from "./SectionReverse"



const Wrapper = styled.section`
    padding: 0;
    margin: 0;
    display: flex;
    flex-direction: column;
@media only screen and (min-width: 992ps){
    flex-direction: column;
    `;
function getImages(i){
    if(i.blue_back){
        return (
               i.blue_back.map((i, index)=>{
                   return (
                       <BlueBack>
                           <ImageHalf image={i.image} />
                       </BlueBack>
                   )
                })
        )
    }else if(i.image_section_reverse){
        return <SectionReverse content={i.image_section_reverse}/>
    }
}
const ImageSection = (props) => (
    <Wrapper>
        {props.image.map((i, index)=>{
            return getImages(i);
        })}
    </Wrapper>
)

export default ImageSection;
